import md5 from "react-native-md5"

function KeyApi()  {
const REACT_APP_API_PUB_KEY = process.env.REACT_APP_API_PUB_KEY;
const REACT_APP_API_DEV_KEY = process.env.REACT_APP_API_DEV_KEY;
const timestamp = Date.now();
const hash = md5(timestamp + REACT_APP_API_DEV_KEY + REACT_APP_API_PUB_KEY);
const URL_KEY = `https://gateway.marvel.com/v1/public/comics?ts=${timestamp}&apikey=${REACT_APP_API_PUB_KEY}&hash=${hash}`;

return URL_KEY
}

export default KeyApi;
